import React from "react";

const Home = () => {
  return (
    <div className="h-screen bg-customColor overflow-x-hidden flex items-center justify-center">
      <div className="text-center">
        <h1 className=" p-1 text-blue-700 font-semibold bg-white">
          WELCOME TO MANAGE WISE
        </h1>
      </div>
    </div>
  );
};

export default Home;
